import { useEffect, useState } from 'react';

const Stations = () => {
    const [data, setData] = useState(null);
    const getData = async () => {
        const response = await fecth ('/data/stations.json')
        const data = await response.json();
        setData(data)
    }

    useEffect(() => getData(), [],)
    if (!data){
        return(
            <ul>
                <li>loading...</li>
            </ul>
        )
    }
    return(
        <ul>
            <li>123</li>
            <li>123</li>
            <li>123</li>
            <li>123</li>
            <li>123</li>
        </ul>
    )
}

export default Stations;
